import React from 'react';
import './App.css';
import Form from './Form'
import {ThemeProvider} from 'styled-components'

function App() {
  return (
    <div className="App">
        <ThemeProvider>
            <Form />
        </ThemeProvider>
    </div>
  );
}

export default App;
